import React from 'react';
import styles from './footer-contact.module.scss';
const FooterContact = ()=> (
<div className='icons'>
        <ul>
            <li><a href="https://twitter.com/posepablo?lang=es " class="twitter"><span class={styles.icon}>  <img src='/socialIcons/twitter-brands.svg' alt="twitter" /></span></a></li>
            <li><a href="https://www.facebook.com/pablo.poseiglesias.1 " class={styles.icon}> <img src='/socialIcons/facebook-f-brands.svg' alt="facebook" /></a></li>
            <li><a href="https://www.instagram.com/pablopose_/?hl=es " class={styles.icon}> <img src='/socialIcons/instagram-brands.svg' alt="instagram" /></a></li> 
        </ul>
</div>
) 

export default FooterContact;
